/* eslint-disable no-unused-vars */
import React from "react";
import "./App.css";

const HomePage = React.lazy(() => import("./Pages/HomePage/HomePage"));
const UsersPage = React.lazy(() => import("./Pages/UserAdmin/UsersPage"));
const UserAdminPage = React.lazy(() => import("./Pages/UserAdmin/UserAdminPage"));
const NewUserPage = React.lazy(() => import("./Pages/UserAdmin/NewUserPage"));
const AddTrackPage = React.lazy(() => import("./Pages/AddTrackPage/AddTrackPage"));
const ClientTrackerPage = React.lazy(() => import("./Pages/ClientTrackerPage/ClientTrackerPage"));
const ClientListPage = React.lazy(() => import("./Pages/ClientListPage/ClientListPage"));
const LoginPage = React.lazy(() => import("./Pages/LoginPage/LoginPage"));
const NewClientPage = React.lazy(() => import("./Pages/NewClientPage/NewClientPage"));
const EditClientPage = React.lazy(() => import("./Pages/EditClientPage/EditClientPage"));
const MyClientsPage = React.lazy(() => import("./Pages/MyClientsPage/MyClientsPage"));

import styles from "./assets/scss/styles.scss";
import { ErrorBoundary } from "react-error-boundary";
import ErrorFallBackComponent from "./components/ErrorFallBack";
import {
  BrowserRouter as Router,
  Switch,
  Redirect,
  Route,
} from "react-router-dom";
import PrivateRoute from "./PrivateRoute.js";
import FooterMenuComponent from "./components/FooterMenuComponent.js";
import ScrollToTop from "./components/ScrollToTop";


function App() {
  return (
    <>
      <Router>
        <ScrollToTop />
        <Switch>
          <ErrorBoundary
            FallbackComponent={ErrorFallBackComponent}
            onReset={() => {
              // reset the state of your app so the error doesn't happen again
            }}
          >
            <Route exact path="/" component={LoginPage} />
            <PrivateRoute exact path="/home" component={HomePage} />
            <PrivateRoute
              exact
              path="/client_tracker"
              component={ClientTrackerPage}
            />
            <PrivateRoute exact path="/add_track" component={AddTrackPage} />
            <PrivateRoute exact path="/users" component={UsersPage} />
            <PrivateRoute exact path="/admin" component={UserAdminPage} />
            <PrivateRoute exact path="/new-user" component={NewUserPage} />
            <PrivateRoute exact path="/client-mng" component={ClientListPage} />
            <PrivateRoute exact path="/new-client" component={NewClientPage} />
            <PrivateRoute
              exact
              path="/edit_client"
              component={EditClientPage}
            />
            <PrivateRoute exact path="/my-clients" component={MyClientsPage} />
            <Redirect to="/" />
          </ErrorBoundary>
        </Switch>
      </Router>
      <br />
      <br />
      <br />
      <br />
      <br />
      <FooterMenuComponent />
    </>
  );
}

export default App;
